'use strict';

var _management = require('ui/management');

require('plugins/kibana/management/sections/objects/_view');

require('plugins/kibana/management/sections/objects/_objects');

require('ace');

require('ui/directives/confirm_click');

var _modules = require('ui/modules');

var _feature_catalogue = require('ui/registry/feature_catalogue');

// add the module deps to this module
_modules.uiModules.get('apps/management');

_management.management.getSection('kibana').register('objects', {
  display: 'Saved Objects',
  order: 10,
  url: '#/management/kibana/objects'
});

_feature_catalogue.FeatureCatalogueRegistryProvider.register(function () {
  return {
    id: 'saved_objects',
    title: 'Saved Objects',
    description: 'Import, export, and manage your saved searches, visualizations, and dashboards.',
    icon: '/plugins/kibana/assets/app_saved_objects.svg',
    path: '/app/kibana#/management/kibana/objects',
    showOnHomePage: true,
    category: _feature_catalogue.FeatureCatalogueCategory.ADMIN
  };
});
